description:
1- Rehabilitación y reparación de grietas de paredes, revestimiento y pintura en el área de la cocina; 
2- Culminación del área administrativa colocación de placa del techo y levantamiento de paredes, revestimiento y pintura colocación de puertas y ventanas; 
3- Sustitución de laminas de yeso del techo cielo raso e impermeabilización de filtraciones en la placa del techo 
4- Dotación de materiales de limpieza, cepillos, haraganes, lava mopas, coletos, rastrillos, palas plásticas, papeleras y contenedores.
5-  Dotación de equipos una silla de rueda y una camilla, un repuesto del rodillo para la maquina de rayos X.
 6- Dotación de instrumentos médicos tensiómetro, glucómetro, nebulizador, estetoscopio, peso, .
